import torch
import torch.nn as nn
import torch.nn.functional as F
import torchvision
import torchvision.transforms as transforms
import matplotlib.pyplot as plt
import numpy as np
import os
from PIL import Image
from torchvision.datasets import ImageFolder
from torch.utils.data import Dataset
import time
from sklearn.metrics import confusion_matrix
import seaborn as sns
import numpy as np
import functools
from tkinter import filedialog
import math
from torchsummary import summary
import subprocess
from io import StringIO
import sys
import csv
import torch.nn.functional as F
import pickle
import csv

##############################################################################################
#                                --ConvertData Class--                                       #
#                                                                                            #
#    The ConvertData class in PyTorch is used to create a custom dataset for handling        #
#    image data. It allows for the loading and transformation of image-label pairs. You      #
#    can specify an optional transformation function during initialization. The              #
#    class's __getitem__ method retrieves and pre-processes the data, while __len__ returns  #
#    the total number of data points in the dataset. This class simplifies the integration   #
#    of custom image datasets into PyTorch, making it easier to preprocess and work with     #
#    image data in machine learning tasks.                                                   #
#                                                                                            #
##############################################################################################
class ConvertData(Dataset):
    def __init__(self,array,transform = None):
        self.array = array
        self.transform = transform

    def __getitem__(self,index):
        image, label = self.array[index]
        if image.mode == 'RGBA':
            image = image.convert('RGB')  # Convert RGBA to RGB
        if self.transform:
            image = self.transform(image)
        return image, label

    def __len__(self):
        return len(self.array)


##############################################################################################
#                                --ConvolutionalNetwork Class--                              #
#                                                                                            #
#    The ConvolutionalNetwork class is a fundamental component for constructing CNNs         #
#    tailored for image classification tasks. It allows users to flexibly configure both     #
#    convolutional and fully connected layers, enabling customization of key architectural   #
#    parameters such as layer dimensions, kernel sizes, strides, padding, dropout rates, and #
#    activation functions. Users can choose from a variety of activation functions,          #
#    including ReLU, sigmoid, tanh, leaky ReLU, PReLU, and ELU, to fine-tune their network.  #
#    The class offers a forward method to process input data through the defined layers,     #
#    applying specified activation functions and dropout techniques.                         #
#                                                                                            #
##############################################################################################
class ConvolutionalNetwork(nn.Module):

    #########################################################################################
    #                                    --Init Function--                                  #
    #########################################################################################
    def __init__(self):
        super(ConvolutionalNetwork, self).__init__()
        self.conv_layers: List[nn.Module] = nn.ModuleList()
        self.fc_layers: List[nn.Module] = nn.ModuleList()
        self.pool_layers: List[nn.Module] = nn.ModuleList()
        self.padding_list: List[nn.Module] = nn.ModuleList()
        self.acts = []
        self.acts2 = []
        self.fc_dropout: List[nn.Module] = nn.ModuleList()
        self.conv_dropout: List[nn.Module] = nn.ModuleList()


    #########################################################################################
    #                            --Configure Convolutional Layers--                         #
    #########################################################################################
    def add_conv_layer(self, in_channels, out_channels, kernel_size_L, kernel_size_W, conv_stride_L, conv_stride_W, pooling_size_L, pooling_size_W, padding_size_L, padding_size_W, pool_stride_L, pool_stride_W, dropoutrate, acti_func, padding_left, padding_top, add_pooling=True, add_padding=True):
        new_conv_layer = nn.Conv2d(in_channels, out_channels, (kernel_size_L, kernel_size_W), stride = (conv_stride_L, conv_stride_W))
        dropoutLayer = nn.Dropout(dropoutrate)
        self.conv_layers.append(new_conv_layer)
        self.conv_dropout.append(dropoutLayer)
        self.acts.append(acti_func)
        if add_pooling:
            pool_layer = nn.MaxPool2d(kernel_size = (pooling_size_L,pooling_size_W), stride = (pool_stride_L,pool_stride_W))
            self.pool_layers.append(pool_layer)
        else:
            self.pool_layers.append(None)

        if add_padding:
            padding_layer = nn.ZeroPad2d((padding_left, padding_size_L, padding_top, padding_size_W)) # (left, right, top, bottom)
            self.padding_list.append(padding_layer)
        else:
            self.padding_list.append(None)


    #########################################################################################
    #                        --Configure Fully Connected Layers--                           #
    #########################################################################################
    def add_fc_layer(self, in_features, out_features,dropoutrate, act_func=1):
        self.acts2.append(act_func)
        new_fc_layer = nn.Linear(in_features, out_features)
        dropoutLayer = nn.Dropout(dropoutrate)
        self.fc_layers.append(new_fc_layer)
        self.fc_dropout.append(dropoutLayer)


    #########################################################################################
    #                        --Configure Fully Connected Layers--                           #
    #########################################################################################
    def forward(self, x):
        for conv_layer, pool_layer, padding, act, dropout in zip(self.conv_layers, self.pool_layers, self.padding_list, self.acts, self.conv_dropout):
            x = conv_layer(x)
            # 0: None, 1: relu, 2: sigmoids, 3: tanh, 4: lrelu, 5: prelu, 6: elu
            if act == 0:
                x = dropout(x)
            elif act == 1:
                x = dropout(F.relu(x))
            elif act == 2:
                x = dropout(torch.sigmoid(x))
            elif act == 3:
                x = dropout(torch.tanh(x))
            elif act == 4:
                x = dropout(F.leaky_relu(x, negative_slope=0.2))
            elif act == 5:
                x = dropout(F.prelu(x))
            elif act == 6:
                x = dropout(F.elu(x))
            elif act == 7:
                x = dropout(F.softmax(x, dim = 1))
            if padding:
                x = padding(x)
            if pool_layer:
                x = pool_layer(x)

        x = x.view(x.size(0), -1)
        for layer, act, dropout in zip(self.fc_layers, self.acts2, self.fc_dropout):
            if act == 0:
                x = dropout(layer(x))
            elif act == 1:
                x = dropout(F.relu(layer(x)))
            elif act == 2:
                x = dropout(torch.sigmoid(layer(x)))
            elif act == 3:
                x = dropout(torch.tanh(layer(x)))
            elif act == 4:
                x = dropout(F.leaky_relu(layer(x), negative_slope=0.2))
            elif act == 5:
                x = dropout(F.prelu(layer(x))) 
            elif act == 6:
                x = dropout(F.elu(layer(x)))
            elif act == 7:
                x = dropout(F.softmax(layer(x), dim = 1))
        return x

##############################################################################################
#                                    --BackEnd Class--                                       #
#                                                                                            #
#    The BackEnd class is the core component of the code. It's responsible for handling data,#
#    training neural networks, and monitoring performance. User can load image data from     #
#    various sources like .jpg files, binary data files, and CSV files using this class. the #
#    class will create data loaders for training & evaluation, allowing users to efficiently #
#    process and feed data to our model. The class also includes a training loop for         #
#    training our convolutional neural network (CNN) model. Additionally, it provides        #
#    plotting functions to visualize metrics like accuracy, loss, and evaluation statistics, #
#    making it a comprehensive tool for machine learning experiments. This class             #
#    streamlines the development and experimentation of image classification models.         #
#                                                                                            #
##############################################################################################
class BackEnd:


    #########################################################################################
    #                                    --Init Function--                                  #
    #########################################################################################
    def __init__(self):
        self.folders = []
        self.datalink = ""
        self.dataset = []
